Having regard to the Treaty establishing the European Community,
Having regard to Council Regulation (EEC) No 3918/92 of 28 December 1992 opening and providing for the administration of Community tariff quotas and ceilings for certain agricultural and industrial products and establishing a reduced variable component  for certain processed agricultural products originating in Hungary, Poland and the territory of the former Czech and Slovak Federal Republic (CSFR) (1), and in particular Article 6 thereof,
Whereas, pursuant to Article 1 of Regulation (EEC) No 3918/92, Hungary, Poland and the territory of the former Czech and Slovak Federal Republic (CSFR) shall benefit from preferential tariff arrangements, in particular the preferential tariff ceilings  laid down in column 6 of Annex I to that Regulation; whereas, pursuant to Article 6, as soon as the ceilings have been reached, the Commission may adopt a regulation re-introducing the customs duties applicable to the third countries in question until  the end of the calendar year;
Whereas those ceilings were reached by charges of imports of the products listed in the Annex, originating in Hungary and in the territory of the former Czech and Slovak Federal Republic, to which the tariff preferences apply;
Whereas, it is appropriate to re-introduce the levying of customs duties with respect of Hungary and the terrirory of the former Czech and Slovak Federal Republic for the products in question,
